import { ListMovieStyled, SingleMovie } from "./styles";

const ListMovie = () => {
  return (
    <ListMovieStyled>
      {[1, 2, 4, 35, 65, 73, 35, 65776, 3, 6, 56, 3].map((item, index) => (
        <SingleMovie kye={index} image={"photo" + index} />
      ))}
    </ListMovieStyled>
  );
};

export default ListMovie;
